import React from 'react';
import classes from './Navbar.module.css';

const Navbar = () => {
    return (
        <div className={classes.Navbar}>
            <div className={classes.right}>
                <h2>Online Store</h2>
                <p>Produce</p>
                <p>Deli</p>
                <p>Bakery</p>
                <p>Frozen</p>
            </div>
            <div className={classes.left}>
                <p>Log In</p>
                <p>Log Off</p>
            </div>

        </div>
    )
}

export default Navbar;
